	// Generate a buffer for our vertex
	glGenBuffers(1, &mVertexBufferID);
	glBindBuffer(GL_ARRAY_BUFFER, mVertexBufferID);

	// Push our data to the buffer
	glBufferData(GL_ARRAY_BUFFER, sizeof(SphereVertexBuffer), SphereVertexBuffer, GL_STATIC_DRAW);

	mSphereNumVertices = sizeof(SphereVertexBuffer) / sizeof(Vertex);
