void SphereModel::Draw()
{
	glBindVertexArray(mVertexArrayID);

	// World-Transform Matrix
	GLuint WorldMatrixID = glGetUniformLocation(Renderer::GetShaderProgramID(), "WorldTransform");
	glUniformMatrix4fv(WorldMatrixID, 1, GL_FALSE, &GetWorldMatrix()[0][0]);

	// Load our vertex data
	// - Vertex Position
	// - Vertex Normal
	// - Vertex Colour
	for (int i = 0; i < 3; ++i)
	{
		glEnableVertexAttribArray(i);
		glBindBuffer(GL_ARRAY_BUFFER, mVertexBufferID);
		glVertexAttribPointer(
			i,
			3,
			GL_FLOAT,
			GL_FALSE,
			sizeof(Vertex),
			(void*)(i * sizeof(vec3))
		);
	}

	glDrawArrays(GL_TRIANGLE_STRIP, 0, mSphereNumVertices);

	for (int i = 2; i >= 0; --i)
	{
		glDisableVertexAttribArray(i);
	}
}

bool SphereModel::ParseLine(const std::vector<ci_string> &token)
{
	if (token.empty())
	{
		return true;
	}
	else
	{
		return Model::ParseLine(token);
	}
}

void SphereModel::Update(float dt)
{
	Model::Update(dt);
}
